import { useRef } from 'react';
import './App.css';

function App() {
  const imgRef = useRef()
  const canvasRef = useRef()
  return (
    <div className="App">
      <img src="https://images.pexels.com/photos/4262010/pexels-photo-4262010.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
        ref={imgRef}
        alt=""
        width="940"
        height="650"
      />
      <canvas
        ref={canvasRef}
        width="940"
        height="650" />

    </div>
  );
}

export default App;
